import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams} from 'react-router-dom';

function App() {
  return (
      <Router>
        <header>
          <nav>
            <ul>
              <li>
                <Link to="/">Главная</Link>
              </li>
              <li>
                <Link to="/catalog">Каталог</Link>
              </li>
            </ul>
          </nav>
        </header>
      </Router>
  );
}

export default App;
